package main

import (
	"fmt"
	"strings"
)

func main() {
	type stru struct {
		field map[string]bool
		tag   map[string]bool
	}

	var res = map[string]stru{}

	lines := strings.Split(mockData, "\n")

	for _, line := range lines {
		if len(line) < 1 {
			continue
		}
		line = line[:strings.LastIndex(line, " ")]
		a := line[:strings.LastIndex(line, " ")]
		b := line[strings.LastIndex(line, " ")+1:]

		_, _ = a, b

		sa := strings.Split(a, ",")
		name := sa[0]
		if _, ok := res[name]; !ok {
			res[name] = stru{
				field: map[string]bool{},
				tag:   map[string]bool{},
			}
		}

		for _, v := range sa {
			sas := strings.Split(v, "=")
			if len(sas) == 2 {
				res[name].tag[sas[0]] = true
			}
		}

		sb := strings.Split(b, "=")
		res[name].field[sb[0]] = true

	}

	for k, v := range res {
		fmt.Println("", k)
		for kk, _ := range v.field {
			fmt.Println("", kk)
		}
		for kk, _ := range v.tag {
			fmt.Println("=", kk)
		}
	}

	// fmt.Println("", res)

}

